(3, '', 'CICLO DE CONFERENCIAS', '2023-11-15', 'LAS FIJAS PARA ENCONTRAR TRABAJO\r\nVicepresidente de Gestión y Desarrollo Humano de Interbank, empresa a la que se unió el año 200Z Desde entonces ha liderado equipos en Transformación de Procesos, Compras y Operaciones. Anteriormente, trabajó como Gerente de BNSF Railway en Texas, Estados Unidos. Julio se graduó como Ingeniero Industrial de St. Mary\'s University y cuenta con una Maestría en Administración de Negocios de SMU Cox School of Business.', 'images/eventos/n-2.jpg'),
