(5, '', 'TARDES DE CONCIENCIA UTP', '2023-11-14', 'Invitamos a toda la comunidad universitaria a\r\nparticipar de Tardes conCiencia UTP - nov\r\n2023, un evento virtual de difusión científica.\r\nParticiparan investigadores UTP compartiendo\r\nlos resultados de sus últimas publicaciones.\r\nViernes 24 de noviembre 3:00 p.m. a 5:00 p.m.', 'images/eventos/n-4.jpg'),
(6, '', 'SEMANA DE LA EDUCACION AMBIENTAL UTP', '2023-11-14', '13 DE NOVIEMBRE\r\nTemas: Educación y Voluntariado Ambiental\r\n\r\n14 DE NOVIEMBRE\r\nTemas: Agua y energía, Economía Circular y Gestión de RRSS y reciclaje\r\n\r\n13 y 14 de noviembre 4:00 p.m. VIA ZOOM', 'images/eventos/n-5.jpg');

