INSERT INTO `noticia` (`id`, `imagen`, `titulo`, `fecha_publicacion`, `descripcion`) VALUES
(3, NULL, 'Innovation Challenge: Estudiantes UTP desarrollaron soluciones', '2023-09-28', 'Durante un mes lleno de energía y colaboración, nuestros estudiantes de Lima, Arequipa y Chiclayo del Programa IMPULSA, aceleradora de talento de UTP, se enfrentaron al desafío de proponer soluciones'),
(4, NULL, 'La UTP se une a la UMAP', '2023-09-25', 'La Universidad Tecnológica del Perú anuncia su incorporación a UMAP, una red de movilidad universitaria que promueve el intercambio académico y cultural entre instituciones de educación superior de 25 países.'),
(5, NULL, 'Estudiantes extranjeros realizaron movilidad estudiantil en la UTP', '2023-10-04', 'Estudiantes de la Universidad Federal de Pernambuco (Brasil), el Instituto Federal de Pernambuco (Brasil), la Universidad Michoacana de San Nicolás de Hidalgo (México), la Universidad del Istmo (Panamá) y la Universidad Nacional de Itapúa (Paraguay) realizaron movilidad presencial y virtual en la UTP durante un ciclo académico.'),
(6, NULL, 'UTP capacita a Docentes de colegios en la elaboración de podcasts en quechua lambayecano', '2023-08-29', 'En nuestra región, más de 25 mil personas (2.34 % de la población lambayecana) tienen como lengua materna el quechua, según el último censo realizado por el Instituto Nacional de Estadística e Informática (INEI), en 2017. Ante esta realidad, el equipo de Investigación del Campus Chiclayo de la Universidad Tecnológica del Perú (UTP), en alianza con la Gerencia Regional de Educación de Lambayeque (GRED), se encuentra capacitando a docentes de colegios nacionales, de educación básica regular, sobre la elaboración de podcasts en esta lengua. Ello beneficiará a los escolares de ciertas zonas rurales de la región, al contribuir en la reducción de la brecha lingüística, además de fortalecer su cultura y ampliar su aprendizaje.'),
(7, NULL, 'Trabajo de investigación de egresados de UTP busca revalorar hongo de Marayhuaca', '2023-08-22', 'Franco Farroñay y Magaly Escobedo, egresados de Ingeniería Industrial del Campus Chiclayo de la Universidad Tecnológica del Perú (UTP), desarrollan el proyecto de investigación “Elaboración y formulación de hamburguesas a base de hongo de Marayhuaca”, en alianza con el Centro de Innovación Tecnológica Turístico Artesanal Sipán (CITE Sipán), el Ministerio de Comercio Exterior y Turismo y la empresa Simbiosis S.A.C. El trabajo lo realizan con la asesoría del Docente Jorge Leiva, quien también los asesora en sus tesis. '),
